import logo from './logo.svg';
import './App.css';
import {Heading, Icon} from 'react-bulma-components';

function Header(props) {
  return <div> <Heading> Turbo Stacks </Heading></div>;
}

function App() {
  return (
    <div className="App">
    <Header/>
    </div>
  );
}

export default App;
